import{_ as a,c as t,o as s,a4 as o}from"./chunks/framework.Bdh9hNeQ.js";const r="/assets/ascreenshot_ee26976bbd1640ef91f4e4c50f0a9f3b_text_export.BThj2zWM.jpeg",i="/assets/ascreenshot_d729ad2f86724ecaae68cd6d1460b7a9_text_export.C5_9tsJE.jpeg",n="/assets/ascreenshot_d03b04d14ffc48cabf902731bb112673_text_export.NC5NgtY2.jpeg",p="/assets/ascreenshot_a34a588c156d4b3eb189ef52b32aba1f_text_export.CAuHv25z.jpeg",c="/assets/ascreenshot_577ef60918064baaa598a66ca537a8f2_text_export.Bsbo3GD3.jpeg",l="/assets/ascreenshot_8875e6be075148778bd1b0eb9b2d1983_text_export.BTlYYjbB.jpeg",d="/assets/ascreenshot_a7c90d2f92ff46bba85dbb894cfd5413_text_export.BySt4hfs.jpeg",h="/assets/ascreenshot_51bbd592ea194208ad508db8fce2a5f3_text_export.CPWfRDjL.jpeg",b="/assets/ascreenshot_14ac56f4a8764f9fb852173326bed4ef_text_export.DOlBOHFY.jpeg",f="/assets/ascreenshot_35e145fe707a423d9ea6089c90460b07_text_export.SWid4vZH.jpeg",_="/assets/ascreenshot_d35ddb63b80a45c38d0fd9346eebc32c_text_export.C5Dl2PCW.jpeg",u="/assets/ascreenshot_bad4a145411c4edfa00da9517910d296_text_export.D-apvU_L.jpeg",m="/assets/ascreenshot_d51afcbe2e334f6eb22356c8bb068a08_text_export.xeo9whhr.jpeg",g="/assets/ascreenshot_77ad57574b04429ea7a820e5ae769fb8_text_export.CZ3BXGRJ.jpeg",C=JSON.parse('{"title":"L. Polar TEP Workspaces","description":"","frontmatter":{},"headers":[],"relativePath":"tutorials/polartep_worskpaces.md","filePath":"tutorials/polartep_worskpaces.md"}'),w={name:"tutorials/polartep_worskpaces.md"};function v(x,e,k,y,P,T){return s(),t("div",null,[...e[0]||(e[0]=[o('<h1 id="l-polar-tep-workspaces" tabindex="-1">L. Polar TEP Workspaces <a class="header-anchor" href="#l-polar-tep-workspaces" aria-label="Permalink to &quot;L. Polar TEP Workspaces&quot;">​</a></h1><p>Polar TEP workspaces are part of the CIF ecosystem, providing capabilities for more powerful analysis by users who are comfortable in a cloud computing environment. A workspace provides:</p><ul><li>Data access</li><li>Application development</li><li>Execution environment</li><li>Data storage and management</li></ul><p>1. Polar TEP workspaces can be accessed at polartep.hub.eox.at &lt;Link&gt;</p><p><img src="'+r+'" alt=""></p><p>2. The resources available to a user are shown in the menu on the left hand side. Those resources will be customized to each user and may not include all those shown in the following slides.</p><p><img src="'+i+'" alt=""></p><p>3. All users will have acces to the Example Notebooks.</p><p><img src="'+n+'" alt=""></p><p>4. All user will have access to the Documentation. The documentation is structured to guide users through a variety of resources and examples.</p><p><img src="'+p+'" alt=""></p><p>5. All users will have access to Jupyter Lab, a flexible, browser-based interface for interactive computing, data analysis, and algorithm development. It is the primary workspace for working with Earth Observation (EO) data, executing Python code, and building reproducible workflows using Jupyter Notebooks.</p><p><img src="'+c+'" alt=""></p><p>6. All users will have access to the Conda Store, which enables users to define and manage reproducible Python environments. This ensures consistent execution across sessions and allows developers to control the underlying libraries and dependencies for their workflows.</p><p><img src="'+l+'" alt=""></p><p>7. All users will have access to Argo Workflows, a workflow orchestration tool, providing a solution for defining and executing multi-step processing pipelines where each step runs in its own container.</p><p>This enables scalable and repeatable execution of applications, supporting both simple tasks and complex, long-running jobs.</p><p>A web-based workflow editor provides an intuitive interface to design, manage, and visualize workflows.</p><p><img src="'+d+'" alt=""></p><p>8. Users may have access to the File Browser, a web-based file management application enabling users to efficiently upload, organize, and manage geospatial data assets.</p><p><img src="'+h+'" alt=""></p><p>9. Users may have access to the Data Editor, which provides a traceable review and approval path of collection configurations before data is published to the configured STAC catalog.</p><p><img src="'+b+'" alt=""></p><p>10. Users may have access to the Publishing Dashboard, a user-facing web interface for presenting and distributing curated datasets and narratives. It centers interactive maps and charts, as well as search and filter capabilities, and can be configured for public sharing or restricted access for defined user groups.</p><p>The Cerulean Information Factory (CIF) interface is an example of a Dashboard.</p><p><img src="'+f+'" alt=""></p><p>11. Users may have access to the Narrative Editor, a content editor for creating and publishing structured narratives combined with Earth Observation (EO) content called &#39;stories&#39;.</p><p>The Cerulean Information Factory (CIF) Dashboard contains example stories.</p><p>More information on the Narrative Editor is available in a separate tutorial (Link).</p><p><img src="'+_+'" alt=""></p><p>12. Users may have access to the Headless Execution capability, enables automated execution of Jupyter notebooks and Argo Workflows directly from the eodash dashboard or programmatically via API endpoints. It is designed for streamlined, reproducible, and user-friendly processing of Earth Observation tasks and workflows.</p><p><img src="'+u+'" alt=""></p><p>13. Users may have access to the Credentials Manager, which allows Workspace secrets—such as API tokens, database credentials, or service keys—to be securely managed and ensures sensitive information is not hard-coded in notebooks, workflows, or shared files.</p><p><img src="'+m+'" alt=""></p><p>14. Users may have access to the eoAPI that provides data visualization capabilities for both raster and vector data. These are powered by titiler-pgstac and PgSTAC, which together enable dynamic tiling and rendering of STAC-compliant assets directly from storage based on pre-defined collection-level metadata fields.</p><p>It exposes a FastAPI based interface, supporting image formats such as PNG and JPEG, and standard interfaces like WMTS.</p><p><img src="'+g+'" alt=""></p><p>15. Return to the Dashboard &lt;Link&gt;</p><p>Return to the Tutorial Contents &lt;Link&gt;</p><p>Continue to the next Tutorial &lt;Link&gt;</p>',40)])])}const E=a(w,[["render",v]]);export{C as __pageData,E as default};
